function manualSwap() external {
    // Only the tax wallet is permitted to trigger a manual swap
    require(msg.sender == _taxWallet, "Caller is not tax wallet");

    // Prevent re-entrancy
    require(!_inSwap, "Already in swap");
    _inSwap = true;

    // Fetch the contract’s token balance
    uint256 contractTokenBalance = balanceOf(address(this));

    // Grant the router an allowance to spend the tokens
    _approve(address(this), address(uniswapV2Router), contractTokenBalance);

    // Create the swap path: token -> WETH
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = uniswapV2Router.WETH();

    // Execute the token->ETH swap
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        contractTokenBalance,
        0,                  // accept any amount of ETH
        path,
        address(this),      // ETH will be sent to this contract first
        block.timestamp
    );

    _inSwap = false;

    // Forward the acquired ETH to the tax wallet
    payable(_taxWallet).transfer(address(this).balance);
}

